import React, { Component } from 'react';
import { Tabs } from 'antd';
import Zillow from "./components/zillow";
import Myhome from "./components/Myhome";
import './App.css';
import 'antd/dist/antd.css';
import MyhomeSearch from './components/MyhomeSearch';

const { TabPane } = Tabs;

class App extends Component {

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <Tabs defaultActiveKey="1">
            <TabPane tab="US" key="1">
              <Zillow />
            </TabPane>
            <TabPane tab="Search Ireland" key="2">
              <MyhomeSearch />
            </TabPane>
            <TabPane tab="Favourites Ireland" key="2">
              <MyhomeSearch />
            </TabPane>
          </Tabs>
        </header>
      </div>
    );
  }
}
export default App;
